    [],nt"num_tags": 3,nt"name": "novel-compact-solid-state-uv-laser-for-ozone-dial-project",nt"isopen":
    true,nt"url": null,nt"notes": "Q-Peak proposes to develop a compact, high-repetition
    rate, dual-line UV source based on the combination of an innovative, efficient,
    high-energy, single-frequency, 1047-nm Nd:YLF laser and efficient, robust nonlinear
    optical frequency converters. The pulse-pumped, repetitively Q-switched, Nd:YLF
    Master Oscillator ? Power Amplifier system will produce single-frequency laser pulses
    with greater than 50 mJ of energy per pulse in a nearly diffraction-limited beam
    at a 1-kHz repetition rate. Conversion of Nd:YLF energy to UV suited for ozone DIAL
    will be accomplished by an efficient combination of harmonic generation and optical
    parametric oscillators.",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
